import React, { useState } from 'react';

function Demo() {
  const [refreshCount, setRefreshCount] = useState(0);
  const [showAdminModal, setShowAdminModal] = useState(false);
  const [adminCode, setAdminCode] = useState('');
  const [isAdminMode, setIsAdminMode] = useState(false);
  
  // Theater status management
  const [theaterStatus, setTheaterStatus] = useState({
    'A': 'Operational',
    'B': 'Operational',
    'C': 'Maintenance'
  });
  
  const [staffList, setStaffList] = useState([
    { id: 1, name: 'John Smith', position: 'Lead', theater: 'A', efficiency: 95 },
    { id: 2, name: 'Sarah Johnson', position: 'Operator', theater: 'A', efficiency: 92 },
    { id: 3, name: 'Michael Brown', position: 'Greeter', theater: 'A', efficiency: 88 },
    { id: 4, name: 'Emily Davis', position: 'Operator', theater: 'B', efficiency: 94 },
    { id: 5, name: 'David Wilson', position: 'Lead', theater: 'B', efficiency: 90 },
    { id: 6, name: 'Jessica Taylor', position: 'Greeter', theater: 'B', efficiency: 89 },
    { id: 7, name: 'Robert Martinez', position: 'Lead', theater: 'C', efficiency: 91 },
    { id: 8, name: 'Lisa Anderson', position: 'Operator', theater: 'C', efficiency: 87 },
  ]);
  
  const verifyAdminCode = () => {
    if (adminCode === '123456789') {
      setIsAdminMode(true);
      setShowAdminModal(false);
    } else {
      alert('Incorrect admin code');
    }
  };
  
  const handlePositionChange = (id, newPosition) => {
    setStaffList(staffList.map(staff => 
      staff.id === id ? {...staff, position: newPosition} : staff
    ));
  };
  
  const handleTheaterChange = (id, newTheater) => {
    setStaffList(staffList.map(staff => 
      staff.id === id ? {...staff, theater: newTheater} : staff
    ));
  };
  
  // Theater status management
  const handleTheaterStatusChange = (theater, status) => {
    setTheaterStatus({
      ...theaterStatus,
      [theater]: status
    });
  };
  
  // Color functions for status
  const getStatusColor = (status) => {
    switch(status) {
      case 'Operational': return '#10b981'; // green
      case 'Maintenance': return '#f59e0b'; // yellow/orange
      case 'Down': return '#ef4444'; // red
      default: return '#10b981';
    }
  };

  return (
    <div style={{ 
      padding: '30px', 
      backgroundColor: '#f5f9ff', 
      fontFamily: 'Segoe UI, Arial, sans-serif',
      borderRadius: '12px',
      boxShadow: '0 4px 20px rgba(0,0,0,0.08)',
      maxWidth: '1100px',
      margin: '30px auto',
      border: '1px solid #e0e8f5'
    }}>
      {/* Admin Login Modal */}
      {showAdminModal && (
        <div style={{
          position: 'fixed',
          top: 0,
          left: 0,
          right: 0,
          bottom: 0,
          backgroundColor: 'rgba(0,0,0,0.5)',
          display: 'flex',
          justifyContent: 'center',
          alignItems: 'center',
          zIndex: 1000
        }}>
          <div style={{
            backgroundColor: 'white',
            padding: '30px',
            borderRadius: '10px',
            width: '350px',
            boxShadow: '0 4px 20px rgba(0,0,0,0.15)'
          }}>
            <h2 style={{ 
              margin: '0 0 20px 0', 
              color: '#0066b2',
              fontSize: '20px'
            }}>Admin Login</h2>
            
            <p style={{ fontSize: '14px', color: '#637385', marginBottom: '15px' }}>
              Enter admin code to access staff management:
            </p>
            
            <input 
              type="password"
              value={adminCode}
              onChange={(e) => setAdminCode(e.target.value)}
              placeholder="Enter admin code"
              style={{
                width: '100%',
                padding: '12px',
                borderRadius: '6px',
                border: '1px solid #ddd',
                marginBottom: '20px',
                fontSize: '15px'
              }}
            />
            
            <div style={{ display: 'flex', justifyContent: 'flex-end', gap: '10px' }}>
              <button
                style={{
                  padding: '10px 15px',
                  backgroundColor: '#f5f5f5',
                  color: '#333',
                  border: 'none',
                  borderRadius: '6px',
                  cursor: 'pointer'
                }}
                onClick={() => setShowAdminModal(false)}
              >
                Cancel
              </button>
              
              <button
                style={{
                  padding: '10px 15px',
                  backgroundColor: '#0066b2',
                  color: 'white',
                  border: 'none',
                  borderRadius: '6px',
                  cursor: 'pointer'
                }}
                onClick={verifyAdminCode}
              >
                Login
              </button>
            </div>
          </div>
        </div>
      )}
      
      <div style={{
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'space-between',
        marginBottom: '20px',
        borderBottom: '2px solid #e0e8f5',
        paddingBottom: '15px'
      }}>
        <div style={{ display: 'flex', alignItems: 'center' }}>
          <div style={{
            width: '40px',
            height: '40px',
            backgroundColor: '#0066b2',
            borderRadius: '8px',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
            color: 'white',
            fontWeight: 'bold',
            fontSize: '20px',
            marginRight: '15px'
          }}>S</div>
          <div>
            <h1 style={{ 
              color: '#0066b2', 
              fontSize: '26px',
              margin: '0 0 4px 0',
              fontWeight: '600',
              letterSpacing: '-0.5px'
            }}>SoarOps Dashboard</h1>
            <p style={{ 
              color: '#637385', 
              fontSize: '15px',
              margin: 0
            }}>Attraction Operations Management System</p>
          </div>
        </div>
        
        {/* Admin Button */}
        <button
          style={{
            padding: '12px 20px',
            backgroundColor: isAdminMode ? '#10b981' : '#0066b2',
            color: 'white',
            border: 'none',
            borderRadius: '6px',
            cursor: 'pointer',
            fontSize: '16px',
            fontWeight: '500',
            boxShadow: '0 3px 10px rgba(0, 0, 0, 0.2)'
          }}
          onClick={() => isAdminMode ? setIsAdminMode(false) : setShowAdminModal(true)}
        >
          {isAdminMode ? 'Exit Admin Mode' : 'Admin Access'}
        </button>
      </div>
      
      {/* Admin Panel */}
      {isAdminMode && (
        <div style={{
          marginBottom: '25px',
          backgroundColor: 'white',
          padding: '25px',
          borderRadius: '10px',
          boxShadow: '0 2px 10px rgba(0,0,0,0.05)',
          border: '1px solid #eef2f8'
        }}>
          <h3 style={{ 
            color: '#0066b2', 
            margin: '0 0 20px 0',
            fontSize: '18px',
            fontWeight: '600'
          }}>
            Theater Status Management
          </h3>
          
          <div style={{ display: 'grid', gridTemplateColumns: '1fr 1fr 1fr', gap: '20px' }}>
            {['A', 'B', 'C'].map(theater => (
              <div key={theater} style={{ 
                backgroundColor: '#f8fbff', 
                padding: '20px', 
                borderRadius: '8px',
                border: '1px solid #eef2f8'
              }}>
                <div style={{ display: 'flex', alignItems: 'center', marginBottom: '15px' }}>
                  <div style={{ 
                    width: '36px', 
                    height: '36px', 
                    borderRadius: '50%', 
                    backgroundColor: getStatusColor(theaterStatus[theater]),
                    display: 'flex',
                    alignItems: 'center',
                    justifyContent: 'center',
                    color: 'white',
                    fontWeight: 'bold',
                    fontSize: '16px',
                    marginRight: '10px'
                  }}>{theater}</div>
                  <div>
                    <p style={{ 
                      margin: '0 0 2px 0',
                      fontWeight: '500',
                      fontSize: '16px'
                    }}>Theater {theater}</p>
                    <p style={{ 
                      margin: 0,
                      fontSize: '13px',
                      color: getStatusColor(theaterStatus[theater]),
                      fontWeight: '500'
                    }}>{theaterStatus[theater]}</p>
                  </div>
                </div>
                
                <p style={{ 
                  margin: '0 0 10px 0', 
                  color: '#637385', 
                  fontSize: '14px' 
                }}>Update Status:</p>
                
                <div style={{ display: 'flex', gap: '10px', flexWrap: 'wrap' }}>
                  <button
                    style={{
                      padding: '8px 15px',
                      backgroundColor: theaterStatus[theater] === 'Operational' ? '#dcfce7' : '#10b981',
                      color: theaterStatus[theater] === 'Operational' ? '#10b981' : 'white',
                      border: theaterStatus[theater] === 'Operational' ? '1px solid #10b981' : 'none',
                      borderRadius: '4px',
                      cursor: 'pointer',
                      fontSize: '14px',
                      fontWeight: '500'
                    }}
                    onClick={() => handleTheaterStatusChange(theater, 'Operational')}
                  >
                    Operational
                  </button>
                  
                  <button
                    style={{
                      padding: '8px 15px',
                      backgroundColor: theaterStatus[theater] === 'Maintenance' ? '#fef3c7' : '#f59e0b',
                      color: theaterStatus[theater] === 'Maintenance' ? '#f59e0b' : 'white',
                      border: theaterStatus[theater] === 'Maintenance' ? '1px solid #f59e0b' : 'none',
                      borderRadius: '4px',
                      cursor: 'pointer',
                      fontSize: '14px',
                      fontWeight: '500'
                    }}
                    onClick={() => handleTheaterStatusChange(theater, 'Maintenance')}
                  >
                    Maintenance
                  </button>
                  
                  <button
                    style={{
                      padding: '8px 15px',
                      backgroundColor: theaterStatus[theater] === 'Down' ? '#fee2e2' : '#ef4444',
                      color: theaterStatus[theater] === 'Down' ? '#ef4444' : 'white',
                      border: theaterStatus[theater] === 'Down' ? '1px solid #ef4444' : 'none',
                      borderRadius: '4px',
                      cursor: 'pointer',
                      fontSize: '14px',
                      fontWeight: '500'
                    }}
                    onClick={() => handleTheaterStatusChange(theater, 'Down')}
                  >
                    Down
                  </button>
                </div>
              </div>
            ))}
          </div>
        </div>
      )}
      
      {/* Main Dashboard Content */}
      <div style={{ 
        display: 'grid',
        gridTemplateColumns: '1fr 1fr',
        gap: '25px',
        marginBottom: '25px'
      }}>
        <div style={{ 
          padding: '25px', 
          backgroundColor: 'white', 
          borderRadius: '10px',
          boxShadow: '0 2px 10px rgba(0,0,0,0.05)',
          border: '1px solid #eef2f8'
        }}>
          <h3 style={{ 
            color: '#0066b2', 
            borderBottom: '1px solid #eef2f8',
            paddingBottom: '12px',
            marginTop: 0,
            marginBottom: '20px',
            fontSize: '18px',
            fontWeight: '600'
          }}>Current Statistics</h3>
          
          <div style={{ display: 'grid', gridTemplateColumns: '1fr 1fr', gap: '20px' }}>
            <div style={{ 
              backgroundColor: '#f8fbff', 
              padding: '15px', 
              borderRadius: '8px',
              border: '1px solid #eef2f8'
            }}>
              <p style={{ 
                margin: '0 0 5px 0', 
                color: '#637385', 
                fontSize: '14px' 
              }}>Total Guests Today</p>
              <p style={{ 
                margin: 0, 
                fontSize: '24px', 
                fontWeight: 'bold', 
                color: '#0066b2' 
              }}>36,542</p>
            </div>
            
            <div style={{ 
              backgroundColor: '#f8fbff', 
              padding: '15px', 
              borderRadius: '8px',
              border: '1px solid #eef2f8'
            }}>
              <p style={{ 
                margin: '0 0 5px 0', 
                color: '#637385', 
                fontSize: '14px' 
              }}>Average Wait Time</p>
              <p style={{ 
                margin: 0, 
                fontSize: '24px', 
                fontWeight: 'bold', 
                color: '#0066b2' 
              }}>45 min</p>
            </div>
            
            <div style={{ 
              backgroundColor: '#f8fbff', 
              padding: '15px', 
              borderRadius: '8px',
              border: '1px solid #eef2f8',
              gridColumn: '1 / span 2'
            }}>
              <p style={{ 
                margin: '0 0 5px 0', 
                color: '#637385', 
                fontSize: '14px' 
              }}>Efficiency Rating</p>
              <div style={{ display: 'flex', alignItems: 'center' }}>
                <p style={{ 
                  margin: 0, 
                  fontSize: '24px', 
                  fontWeight: 'bold', 
                  color: '#0066b2',
                  marginRight: '10px'
                }}>94%</p>
                <div style={{
                  height: '6px',
                  backgroundColor: '#e0e8f5',
                  borderRadius: '3px',
                  width: '150px',
                  position: 'relative'
                }}>
                  <div style={{
                    position: 'absolute',
                    height: '6px',
                    width: '94%',
                    backgroundColor: '#0066b2',
                    borderRadius: '3px'
                  }}></div>
                </div>
              </div>
            </div>
          </div>
        </div>
        
        <div style={{ 
          padding: '25px', 
          backgroundColor: 'white', 
          borderRadius: '10px',
          boxShadow: '0 2px 10px rgba(0,0,0,0.05)',
          border: '1px solid #eef2f8'
        }}>
          <h3 style={{ 
            color: '#0066b2', 
            borderBottom: '1px solid #eef2f8',
            paddingBottom: '12px',
            marginTop: 0,
            marginBottom: '30px',
            fontSize: '18px',
            fontWeight: '600'
          }}>Theater Status</h3>
          
          <div style={{ 
            display: 'flex', 
            justifyContent: 'space-around', 
            alignItems: 'center',
            height: '100%'
          }}>
            {['A', 'B', 'C'].map(theater => (
              <div key={theater} style={{ textAlign: 'center' }}>
                <div style={{ 
                  width: '50px', 
                  height: '50px', 
                  borderRadius: '50%', 
                  backgroundColor: getStatusColor(theaterStatus[theater]),
                  margin: '0 auto 12px',
                  boxShadow: `0 2px 8px ${getStatusColor(theaterStatus[theater])}50`,
                  display: 'flex',
                  alignItems: 'center',
                  justifyContent: 'center',
                  color: 'white',
                  fontWeight: 'bold',
                  fontSize: '18px'
                }}>{theater}</div>
                <p style={{ 
                  margin: 0,
                  color: '#333',
                  fontWeight: '500'
                }}>Theater {theater}</p>
                <p style={{ 
                  margin: '5px 0 0 0',
                  color: getStatusColor(theaterStatus[theater]),
                  fontSize: '13px',
                  fontWeight: '500'
                }}>{theaterStatus[theater]}</p>
              </div>
            ))}
          </div>
        </div>
      </div>
      
      <div style={{
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
        borderTop: '1px solid #e0e8f5',
        paddingTop: '20px'
      }}>
        <p style={{ 
          margin: 0, 
          fontSize: '13px', 
          color: '#637385' 
        }}>
          Last updated: {new Date().toLocaleTimeString()}
        </p>
        
        <button 
          style={{
            padding: '10px 20px',
            backgroundColor: '#0066b2',
            color: 'white',
            border: 'none',
            borderRadius: '6px',
            cursor: 'pointer',
            fontWeight: '500',
            boxShadow: '0 2px 4px rgba(0, 102, 178, 0.2)',
            display: 'flex',
            alignItems: 'center'
          }}
          onClick={() => {
            setRefreshCount(refreshCount + 1);
            alert(`Dashboard refreshed! (${refreshCount + 1} times)`);
          }}
        >
          Refresh Dashboard
        </button>
      </div>
    </div>
  );
}

export default Demo;
